import React from "react";

export default function Home() {
  return (
    <div
      style={{
        flexDirection: "column",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        backgroundColor: "coral",
        height: "100vh",
      }}
    >
      <h1 style={{ color: "white" }}>Este es el home!</h1>
      <button>
        <a href="/">Volver a la landing!</a>
      </button>
    </div>
  );
}
